for s in [s_10, s_100, s_1000]:
    N = len(s)
    
    # Get stats variables from solution
    fit_moyenne, fit_ecart_type = stats.norm.fit(s)
    label = "Moyenne ="+"{:.2f}".format(fit_moyenne)+"\n"+"Ecart-type ="+"{:.2f}".format(fit_ecart_type)+"\n"
    
    # Get  CDF
    #xmin = fit_moyenne - 2*fit_ecart_type
    #xmax = fit_moyenne + 2*fit_ecart_type
    xmin = np.min(s); xmax = np.max(s)
    lnspc = np.linspace(xmin, xmax, 1000)
    cdf = stats.norm.cdf(lnspc, fit_moyenne, fit_ecart_type)
    print(fit_moyenne, fit_ecart_type)
    
    # Plot solution
    if N<200: plt.figure(figsize=(5,3))
    plt.hist(s, 20, cumulative = True, density=True,  alpha = 0.7)
    plt.plot(lnspc, cdf, label=label)
    plt.title("Histogramme cumulatif et CDF des permeabilité, N="+str(N))
    plt.xlabel("Permeabilité")
    plt.ylabel("Nombre")
    plt.legend()
    plt.show()
